import React from 'react';

const headerStyles = {
  header: {
    position: 'relative',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    minWidth: '320px',
  },
  logo: {
    paddingTop: '24px',
    paddingLeft: '20px',
  },
  linkArea: {
    padding: '15px 0',
  },
  vector: {
    position: 'absolute',
    width: '1500px',
    height: '0px',
    left: '300px',
    top: '105px',
    border: '2px solid #E4E2DD',
    transform: 'rotate(0.01deg)',
  },
};

function Header() {
  return (
    <header style={headerStyles.header} className="page-header">
      <div className="logo-thumb">
        <a style={headerStyles.linkArea} href="/">
          <img style={headerStyles.logo} src="./src/components/img/logo-tabaco.svg" alt="Логотип компанії" />
        </a>
      </div>
      <div className="menu" data-menu>
        <div className="container menu__container">
          <nav className="nav">
            <ul className="site-nav list">
              <li className="site-nav__item">
                <a className="site-nav__link link site-nav__link--current" href="/">Головна</a>
              </li>
              <li className="site-nav__item">
                <a className="site-nav__link link" href="/goods">Товари</a>
              </li>
            </ul>
          </nav>
          <div style={headerStyles.vector} />
        </div>
      </div>
    </header>
  );
}

export default Header;
